import styles from './Contact.module.css'

function Contact() {
    return(
        <div className={styles.contact}>
            <h2>Contact Forms</h2>
            <div className={styles.column}>
                <div className={styles.content}>
                    <i class="fa-brands fa-facebook"></i>
                    <h3>Facebook</h3>
                </div>
            </div>
        </div>
    );
}

export default Contact;
